void update_board(int inc) {
    // Copying values from old_board to board, shifting them down by speedOfGame rows
    for (int x = 0; x < numPixelsX; x++) {
        for (int y = 0; y < numPixelsY - speedOfGame; y++) {
            board[x][y + speedOfGame] = prev_board[x][y];
			PS2_data = *(PS2_ptr);
			RVALID = PS2_data & 0x8000; // extract the RVALID field
			if (RVALID) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
			}
        }
        // Reset the top row to white
        board[x][0] = WHITE;
    }

    // Generate new blocks or food items based on conditions
	int rowsBlocksRepeat;
	if(easyMode){
    	 rowsBlocksRepeat = 6; // box amount ranges from 0 - numCol
	} else if (mediumMode){
		rowsBlocksRepeat = 4; // box amount ranges from 0 - numCol
	} else {
		rowsBlocksRepeat = 3; // box amount ranges from 0 - numCol
	}
	
    if (inc % (rowsBlocksRepeat*(30/speedOfGame)) == (rowsBlocksRepeat*(30/speedOfGame))-1) {
        random_box();
    } else if (inc % (30/speedOfGame) == (30/speedOfGame)-1) {
        random_food();
    }
	
	 for (int x = 0; x < numCols; x++)
    {
        //board[x][0] = WHITE;
		setBox(x * width, 0, WHITE, width, speedOfGame);
    }
	
	

}

short int get_hex(int num){
	
	if(num == 1) {
		return RED;
	} else if (num == 2) {
	    return ORANGE;
	} else if (num == 3) {
		return BLUE;
	} else if (num == 4) {
		return CYAN;
	} else if (num == 5){
		return PURPLE;
	} else if (num == 6){
		return PINK;
	} else if (num == 7){
		return MAGENTA;
	} else if (num == 8){
		return YELLOW;
	} else { // num is 9
		return BROWN;
	}
}

int get_num(short int hex){

    if(hex == -2048) { // RED in RGB565
        return 1;
    } else if (hex == -768) { // ORANGE in RGB565
        return 2;
    } else if (hex == 15) { // BLUE in RGB565
        return 3;
    } else if (hex == 2047) { // CYAN in RGB565
        return 4;
    } else if (hex == -32752) { // PURPLE in RGB565
        return 5;
    } else if (hex == -1000) { // PINK in RGB565
        return 6;
    } else if (hex == -2017) { // MAGENTA in RGB565
        return 7;
    } else if (hex == -32) { // YELLOW in RGB565
        return 8;
    } else { // color is brown or undefined
        return 9;
    }
}


