void get_snake_pos()
{
	
	if (((byte2 == (char)0x23) || (byte3 == (char)0x23 && byte2 == (char)0xF0)) && (snake_pos < numCols - 1)){
		byte3 = 0;
		byte2 = 0;
		byte1 = 0;
		// over ride the previous mouse guy!
		setBox(snake_pos*width, 180, WHITE, width, height);
		setBox(snake_pos*width, 210, WHITE, width, height);
        snake_pos++;
		//printf("d");
	}
	else if (((byte2 == (char)0x1C) || (byte3 == (char)0x1C && byte2 == (char)0xF0)) && (snake_pos > 0)){
		byte3 = 0;
		byte2 = 0;
		byte1 = 0;
		// over ride the previous mouse guy!
		setBox(snake_pos*width, 180, WHITE, width, height);
		setBox(snake_pos*width, 210, WHITE, width, height);
        snake_pos--;
		//printf("a");
	}
	
	else {
		setBox(snake_pos*width, 210, WHITE, width, height);
		
	}
}


int getLowestY(int x_pos, int currentBox)
{
    // in this sense "lowestY" means highest number/ lowest on the board
    int lowestY = 180;
    for (int y = 180; y < 210; y++)
    {
        if (board[x_pos][y] == currentBox && y > lowestY)
        {
            lowestY = y;
        }
    }
    return lowestY;
}

