void setBox(int topLeftCornerX, int topLeftCornerY, short int colour, int sizeX, int sizeY)
{

    for (int x = topLeftCornerX; x < topLeftCornerX + sizeX; x++)
    {
        for (int y = topLeftCornerY; y < topLeftCornerY + sizeY; y++)
        {
			PS2_data = *(PS2_ptr);
			RVALID = PS2_data & 0x8000; // extract the RVALID field
			if (RVALID) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
			}
            board[x][y] = colour;
        }
    }
	
}

void setCircle(int centerX, int centerY, int radius, short int colour)
{
    int x, y;
    int radiusSquared = radius * radius;

    for (x = centerX - radius; x <= centerX + radius; x++)
    {
        for (y = centerY - radius; y <= centerY + radius; y++)
        {
            int distanceSquared = (x - centerX) * (x - centerX) + (y - centerY) * (y - centerY);
            if (distanceSquared <= radiusSquared)
            {
                if (x >= 0 && x < numPixelsX && y >= 0 && y < numPixelsY)
                {
                    // Assuming `board` is your pixel buffer
                    board[x][y] = colour;
                }
            }
        }
    }
}


void clear_screen() // initial clear screen
{
    int y, x;
    for (x = 0; x < numPixelsX; x++)
        for (y = 0; y < numPixelsY; y++)
            plot_pixel(x, y, WHITE); // draw all white
}

void plot_pixel(int x, int y, short int line_color)
{
    volatile short int *one_pixel_address;

    one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);

    *one_pixel_address = line_color;
}

void wait_for_vsync()
{
    volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
    int status;
    *pixel_ctrl_ptr = 1;                   //start the synchronization
    status = *(pixel_ctrl_ptr + 3);        // Now wait for s bit to become 0 again, tells you its ready to render again
    while ((status & 0x01) != 0)
    {
		PS2_data = *(PS2_ptr);
		RVALID = PS2_data & 0x8000; // extract the RVALID field
		if (RVALID) {
			byte1 = byte2;
			byte2 = byte3;
			byte3 = PS2_data & 0xFF;
		}
        status = *(pixel_ctrl_ptr + 3); // polling
    }
}


void playSound(int *samples, int n) {
	int i;

	audiop->control = 0x8; // clear the output FIFOs
	audiop->control = 0x0; // resume input conversion
	for (i = 0; i < n; i++) {
		// wait till there is space in the output FIFO
		while (audiop->warc == 0);
		audiop->ldata = samples[i];
		audiop->rdata = samples[i];

	}
}	

void set_num(int xLoc, int yLoc, int number){ //note, you xLoc and yLoc are the top left corner and you must ensure that the drawing is within bounds yourself
	for (int x = 0; x < numberWidth; x++){
		for (int y = 0; y < numberHeight; y++){
			if(smallerNumbers[y][(number*numberWidth)+(number*numberExtraSpace)+x] != 0xffff){
				board[x+xLoc][y+yLoc] = smallerNumbers[y][(number*numberWidth)+(number*numberExtraSpace)+x];
			}
			PS2_data = *(PS2_ptr);
			RVALID = PS2_data & 0x8000; // extract the RVALID field
			if (RVALID) {
				byte1 = byte2;
				byte2 = byte3;
				byte3 = PS2_data & 0xFF;
			}
		}
	}
}
	